import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { useHistory } from "react-router-dom";

import { Container, Row, Col, Card, CardHeader, Button } from "shards-react";
import { getAllDietitians } from "../../actions/superadmin/dietician";
import { getDietitians } from "../../apiConstants/apiConstants";
import PageTitle from "../../components/common/PageTitle";

export default function Dietitians(params) {
  const [dietitians, setDietitians] = useState();
  const allDietitians = useSelector(state => state.allDietitians);
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(getAllDietitians(getDietitians));
  }, []);

  useEffect(() => {
    setDietitians(
      allDietitians.data && allDietitians.data.results.fikter()
    )
  }, [allDietitians]);

  return (
    <Container>
      <Row noGutters className="page-header py-4">
        <PageTitle
          sm="4"
          title="Dietitians"
          subtitle="Dashboard"
          className="text-sm-left"
        />
      </Row>
    </Container>
  );
}
